INSERT INTO `products` VALUES (69,'apparel-machines',21313,230,21,'Burgomaster (alternatively spelled burgermeister, literally master of the town, master of the borough, master of the fortress, or master of the citizens) is the English form of various terms in or derived from Germanic languages for the chief magistrate or executive of a city or town. The name in English was derived from the Dutch burgemeester. In some cases, Burgomaster was the title of the head of state and head of government of a sovereign (or partially or de facto sovereign) city-state, sometimes combined with other titles, such as Hamburg s First Mayor and President of the Senate). Contemporary titles are commonly translated into English as mayor.',107,1,'2020-07-10 14:52:07',13123,22,'123123','0',2,'10','1','0',NULL,'1','1','0',NULL),(70,'Craft n Creations\nThe Craft House',500,90,21,'Burgomaster (alternatively s',107,1,'2020-07-10 15:35:58',234,22,'23','0',2,'10','1','0',NULL,'1','1','0',NULL),(71,'The Craft HouseThe Craft House',2131,340,21,'Burgomaster (alternatively spelled burgermeister, literally master of the town, master of the borough, master of the fortress, or master of the citizens) is the English form of various terms in or derived from Germanic languages for the chief magistrate or executive of a city or town. The name in English was derived from the Dutch burgemeester. In some cases, Burgomaster was the title of the head of state and head of government of a sovereign (or partially or de facto sovereign) city-state, sometimes combined with other titles, such as Hamburg s First Mayor and President of the Senate). Contemporary titles are commonly translated into English as mayor.',107,1,'2020-07-10 15:51:50',12312,22,'sdfsdf','0',2,'10','1','0','','1','1','0',NULL),(72,'Is the name simple and easy to remember?',1000,135,21,'Burgomaster ',1,1,'2020-07-10 15:53:37',12,22,'as','0',2,'10','1','1','','1','1','0',NULL),(73,'The Rustic Door',12,239,21,'Burgomaster (alternatively spelled bu